import React from "react";

import Banner from "../Reportes/Sections/Banner/Banner.jsx";
import Component from "./Sections/ListContent/ListContent.jsx";

export default function Base({
  thumbnail_banner,
  title,
  text,
  route,
  listType,
  nPorPagina,
}) {
  return (
    <>
      <Banner img={thumbnail_banner} title={title} text={text ? text : null} />
      <Component route={route} listType={1} nPorPagina={2} title={title} />
    </>
  );
}
